 follow the instruction of her employer. She loves reading of magazines and does cleaning when she has free time.\\r\\n\\r\\n\\r\\n\\r\\nExperience\\r\\n\\r\\nShe works as a helper in Singapore for a total of 4 years. In her 1st employer, she works in a big house; 3 storey house, 5 bedrooms and 5 bathrooms. She was in charge of cleaning the house, do gardening and take care of dog. She also washes the car 3 times per week and sometimes she cooks.\\r\\n\\r\\nIn her 2nd employer, she and her employer agreed that she will only work for a year because her passport will expires after a year. Her main responsibilities were cleaning and cooking. She also looks after the 2 kids ages 12 and 15. She also cooks for her employer.\\r\\n\\r\\n\\r\\n\\r\\nCooking\\r\\n\\r\\nWorking in Singapore for 4 years, she learns some of the basic Chinese dishes.\\r\\n\\r\\n\\r\\n\\r\\nChild care\\r\\n\\r\\nShe is comfortable she could manage to take care of children and infants not just because of her past experience but because she is also a mother who takes care of her children since they were born.\\r\\n\\r\\n\\r\\n\\r\\nPet care\\r\\n\\r\\nShe has past experience taking care of pet and she was able to manage that.\\r\\n\\r\\n\\r\\n\\r\\nHand phone\\r\\n\\r\\nShe is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.  She will follow the employer\'s instruction regarding hand phone usage.\\r\\n\\r\\n\\r\\n\\r\\n2 years contract\\r\\n\\r\\nShe is aware that she will enter into 2 years contract with her future employer and she is committed to finish.\\r\\n\\r\\n\\r\\n\\r\\nRecommendation\\r\\n\\r\\nI could see that based on her personality, she doesn\'t talk a lot but I could see her honesty and sincerity that she is willing and determine to do her job well. I could see that she talks less but work hard. I could see that she has no problem following instructions. She works in Singapore for a total of 4 years already and I believe that her adjustment to a new environment would just be minimal. I hope that you give her a chance to work with you. Please view her profile and consider her then.\\r\\n\",\n    \"users_agents_id\": \"53\",\n    \"users_agents_company_name\": \"\",\n    \"created_at\": \"2016-02-04 01:53:35\",\n    \"updated_at\": \"2016-02-04 06:53:35\",\n    \"deleted\": \"N\",\n    \"profile_image\": \"99761.jpg\",\n    \"availability\": \"Available\",\n    \"expected_salary\": \"0.00\",\n    \"passport_number\": \"\",\n    \"work_permit_no\": \"\",\n    \"video_link\": \"https:\\/\\/youtu.be\\/kjRuJroe-9s\"\n}','2016-02-15 07:10:50','2016-02-15 12:09:31',0);
