e employer teach her ans she can also follow recipe book.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work. &nbsp;She will follow the employers instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is committed to finish her 2 years contract with her employer as she really needs to support her family. She says that a good helper is hardworking, honest and trustworthy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>I can see that she is one who is sincere and willing to work and base on her own experience she took care of her own siblings. Coming to Singapore may take a little while to adjust but I do believe that she will be able to settle down, so hope you give her a chance to serve your family. &nbsp;</p>\r\n'),(186,'Jalyn Bañares','1989-12-22','Oton Iloilo ',150,30,11,'Philippines','Philippines','66929011','JAL253119','Catholic',3,'New',0,'Married',1,'2','20192.jpg','No','','No','','No','','','','','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-02-29 03:58:53','2016-02-04 15:33:53','Y','45430.jpg','Available',0.00,'','','https://youtu.be/512zxYHva60',NULL,''),(187,'Hasmine Tagacay','1990-01-13','Tubungan Iloilo',150,48,11,'Philippines','Philippines','66929011','JAL253140','Catholic',4,'New',4,'Single',NULL,'','58308.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-14 12:29:57','2016-03-14 16:29:57','N','77171.jpg','Available',0.00,'','','https://youtu.be/w3gR_9zfqa0',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 25 years of age, single and the eldest among 4 siblings. She stands 150 cm and weighs 48 kg. &nbsp; She wants to work in Singapore to support the n