ware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>I could see that she is experienced in household works and even in cooking. She knows how to take care of kids since she is also a mother. She is determined to work especially that she needs to supports her children. She is willing to learn. Her personality is someone who will not quit easily. She has self-motivation towards her goal and that is to be a good helper. She is focus and hardworking. I hope that you view her profile and consider her then.</p>\r\n'),(191,'Juliet Arandela','1989-03-07','Pototan Iloilo',149,60,11,'Philippines','Philippines','66929011','JAL263085','Catholic',4,'New',5,'Single',NULL,'','40610.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-03 06:23:04','2016-03-03 11:23:04','N','78685.jpg','Available',0.00,'','',' http://youtu.be/PkHPRT_BJNc',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 26 years of age, single and youngest among 5 siblings. She stands 149 cm and her weight is 60 kg. The reason why she wants to work in Singapore is to secure the future of her brothers and sisters. She discussed with her family and they are agreeable that she will be away for 2 years.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She is hardworking person, honest and loyal. She loves cooking, gardening and sewing during her free time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She can do house cleaning, cooking, washing clothes and ironing.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Child care</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>She took care of new born baby from 0 month to 2 years old. She would check his diaper and change when it is wet or dirty, prepare milk for him and take him a bath.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eldercare</strong></p>\r\n\r\n<p>She took care of her own grandmother who suffered from arthritis. She accompany her when she needs to go toilet and take showers and attend to her needs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She cooks Filipino dish like afritada, pochero. She can follow recipe book and learn Chinese cooking.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work. She is also okay to stay back during off day.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is committed to finish her 2 years contract with her employer as she really needs to support her family. She say that she will be&nbsp; responsible helper and fulfil her task.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She is suitable for small family with children and new born baby, on the other hand does house work, she can cook and take care of elderly. Given time to adjust she will pick up fast and able to manage her task. So hope you give her chance to serve your family and I belive that she will be a good helper.</p>\r\n'),(192,'Michaela Fe Cabus','1989-09-28','Manila',152,42,11,'Philippines','Philippines','66929011','JAL263142','Catholic',3,'New',3,'Separated',1,'2','52855.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-14 13:30:05','2016-03-14 17:30:05','N','27084.jpg','Unpublished for display',0.00,'','','https://youtu.be/gWPCShWohFw',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 26 years of age, separated, and she has a 2 year old child. She wants to work in Singapore for the future of her son and to help her mother. While away for 2 years, her sister will be responsible in taking care of her child.<