;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>I could see that she is someone who is hardworking. She could manage to take care of kids and she is suitable to take care of an elderly. Based on her built and experience. I don&#39;t hink that she needs much adjustment when it comes to household chores and cooking. I do believe that she could be able to adapt and do her job well. I hope that you look into her profile and consider her then.</p>\r\n'),(212,'Yolanda Montalban','1984-09-06','Dumalag Capiz',152,48,11,'Philippines','Philippines','66929011','JAL313152','Catholic',3,'New',2,'Married',2,'8,10','32131.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-02-18 09:41:04','2016-02-05 06:22:14','Y','72171.jpg','Available',0.00,'','','https://youtu.be/cfJQGEdVryE',NULL,''),(213,'Jessa Samillano','1984-08-23','San Remigio Antique',157,54,11,'Philippines','Philippines','66929011','JAL313162','Christian',4,'New',6,'Married',2,'6,3','35536.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-14 13:11:32','2016-03-14 17:11:32','N','78685.jpg','Available',0.00,'','','https://youtu.be/LNotvlR7gA0',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 31 years of age, married and has 2 kids ages 3 and 6. &nbsp;She wants to work in Singapore as a domestic helper to support her kids . While away for 2 years, her husband will take care of their children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as sincere, honest and friendly. When she has free time, she loves to cook and clean the house. For her, a good helper should be trustworthy and honest.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>As a mother, she took care of her own children since they were born. And as a housewife, she does cooking,