 work hard and to learn new things. I could see that she has enough experience to take care of infants and children. And she is also hardworking and very capable. I hope that you give her a chance and view her profile and consider her then.</p>\r\n'),(215,'Adhel Tanate','1983-05-10','Gumaca Quezon',160,60,11,'Philippines','Philippines','66929011','JAL323124','Catholic',4,'New',4,'Married',0,'','63309.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-12 04:09:57','2016-03-12 09:09:57','N','86257.jpg','Unpublished for display',0.00,'','','https://youtu.be/bPjQk5arzF8',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 32 years of age, married and has no children. She has 2 sisters and 1 brother. She stands 160 cm and weighs 60 kg. She wants to work in Singapore to support her family and her niece.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as hardworking, honest and hardworking. And she loves to cook.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as a housemaid for more than 4 years where she does household works; she does house cleaning, cooking and laundry. She takes care of a disabled person; she would feed her, take him a bath, change the diaper, and give a massage. She would also make her take the medicine and read her stories.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She knows how to cook and willing to learn Chinese dishes and she will cook breakfast, lunch and dinner.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She is willing to take care of children and she has experience in taking care of children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Special care</strong></p>\r\n\r\n<p>She is willing to take care of a disabled person; in fact, she has experience in taking care of a person with special needs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Elderly care</strong></p>\r\n\r\n<p>She has experience in taking care of an elderly and she is willing to take care of them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>I could see that she is a responsible person. She is good both in an elderly and person with special needs care. She is strong woman and very capable. I could see that she is willing to follow instruction and is willing to learn new things from her future employer. She just needs a little time to adjust but I know she could handle anything because she is motivated. I hope that you view her profile and consider her then.</p>\r\n'),(216,'Glosee Tamba','1982-03-04','Pilippines',150,40,11,'Philippines','Philippines','66929011','JAL333141','Others',4,'New',5,'Single',NULL,'','66727.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-02-29 03:58:34','2016-02-05 10:40:01','Y','89053.jpg','Available',0.00,'','','https://youtu.be/_qUhmTXoY34',NULL,''),(217,'Anabelle Zapansa','1982-10-21','San Jose Antique',152,42,11,'Philippines','Philippines','66929011','JAL333161','Catholic',3,'New',3,'Separated',3,'4,6,7','74686.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-02-29 03:57:57','2016-02-05 10:48:04','Y','73332.jpg','Available',0.00,'