 contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She shows willingness and determination to learn new things. She works as a domestic helper already and knows house works. I could see that she is hard working and dedicated to her work. I hope you give her a chance and view her profile and consider her then.</p>\r\n'),(219,'Malou Genise','1981-05-04','Bacolod City',150,44,11,'Philippines','Philippines','66929011','JAL343173','Christian',4,'Ex-Singapore',2,'Single',NULL,'','30724.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-19 05:48:39','2016-03-19 09:48:39','N','21313.jpg','Unpublished for display',0.00,'','','https://youtu.be/7bPUNYU9esQ',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 34 years of age, single, she has 1 sister and she is the youngest. She wants to work in Singapore as domestic helper to save money for her future.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as honest. She loves cooking and wants to learn Chinese cooking. Working in Singapore, she learns to follow the rules and to be honest to the employer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as helper in Singapore for more than 2 years with 2 employers. For her 1st employer, she works for 4 months, her responsibility was to take care of an elderly. She works for 4 months before she was transferred due to miscommunication because the elderly cannot speak English.</p>\r\n\r\n<p>In her 2nd employer, she works for 2 years and 4 months where her main responsibilities were to cook, clean the house and take care of an elderly as well and does marketing.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>While in Singapore, she prepares meals for her employer and is willing to learn more ways of cooking.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She is willing to take care of children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Elderly care</strong></p>\r\n\r\n<p>In her previous jobs in Singapore, she takes care of an elderly and she has managed that. She is suitable for an eldercare.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>I could see that she has experience in household works and taking care of an elderly. I could see that she is someone who is focused to what she does. She is able to cook. She works in Singapore for more than 2 years, and I believe that just adjustments will only be minimal. Therefore, I could see that she is suitable to be your helper. I hope that you view her profile and consider her then.</p>\r\n'),(220,'Jocelyn Alejo','1980-06-09','Tubungan Iloilo',149,52,11,'Philippines','Philippines','66929011','JAL353076','Catholic',3,'New',2,'Married',1,'11','52138.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-17 06:25:07','2016-03-17 10:25:07','N','64529.jpg','Available',0.00,'','','https://youtu.be/-tKZgUCgpj4',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 35 years old married, with 11 years old son. Stands 149 cm and her weight is 52 kg.&nbsp;&nbsp; The reason why she wants to work in Singapore is to support her family especially for the future of her son and her husband is agreeable that she apply for Singapore. Her mother in-law will be responsible for their son while she is in Singapore.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as a jolly person and teachable willing to learn things.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works in Lebanon for 1 year and 3 months, unfortunately because of the war between Lebanon and Syria she was not able to finish her contract and was sent back to Philippines.</p>\r\n\r\n<p>The house is single story with 3 bedrooms. She wake up 5&nbsp; o clock in the morning then she would start cleaning the hall way, computer room and dinning hall. After that she would wake the children (they are 10 &amp; 8 years old) and sent them to school. When she return to the house she would continue to do house cleaning, doing Laundry and ironing as well.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;Child care</strong></p>\r\n\r\n<p>She can take care of new born baby and children as she is a mother herself and she also has experience taking care of children in Lebanon.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pets/dogs</strong></p>\r\n\r\n<p>She took care of dogs in Philippines as she work in the house of her employer. She is willing to take care of pets in Singapore if the employer will require her.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She can cook Lebanese food like grilled lamb, spaghetti, pizza and vegetables salad. She is willing to learn Chinese cooking in Singapore as the employer teach her and she can follow recipe book.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is aware that the employer in Singapore will not allow her to use hand phone during working hours, so that she can focus on her duties and don&#39;t get distracted. She will follow the employer&#39;s instruction regarding hand phone usage.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into a contract with her employer in Singapore and she is committed to complete 2 years contract. During her previous work as a helper in Lebanon, she had learn discipline in terms of hygiene and cleanliness. According to her, a good helper is honest and loyal and most importantly she must be able to follow instructions.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She is a working type of a person, focus and being a mother and also experience in Lebanon she should be able to handle children and new born baby as well and also for cooking and housework. She will be good helper for family with children and can also manage taking care of pets. Hope you look into her profile and consider her then.</p>\r\n'),(221,'Sandra Gonzales','1979-09-01','Iloilo City',152,52,11,'Philippines','Philippines','66929011','JAL353110','Catholic',3,'Ex-Singapore',3,'Separated',1,'11','35270.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-17 06:26:08','2016-03-17 10:26:08','N','40974.jpg','Available',0.00,'','','https://youtu.be/fijWIxVtrG4',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 35 years of age, separated, and has 1 child age 12. She is the youngest in the family with 2 siblings. She wants to work in Singapore to support her child and also her family. While be away for 2 years, her mother will be responsible to look after her child.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as honest and respectful. During her free time, she likes to read books.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works in Singapore for more than 3 years. In her 1st employer, she finish her contract, she was responsible for a 5 year old child. She prepares her and sends her to school and waited there for 2-3 hours until the class is over. She would also play with her. She also works as a helper of an elderly person. And in another employer, she also took care of the children and cook for their meals.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She prepares breakfast, lunch and dinner for her previous employer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She is willing to take care of children since her previous work also involves in taking care of a 5 year old child.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Elderly Care</strong></p>\r\n\r\n<p>She is willing to take care of an elderly. Her other previous job was also to take care of an elderly person. She takes her to shower, prepares her meal and helps her do her exercise.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>I could see that she is committed to work hard and to finish her contract. She works as helper already and I believe that adjustment will not be difficult for her to handle. She also has past experiences in taking care of an elderly and children. I hope you give her a chance. Please view her profile and consider her then.</p>\r\n'),(222,'Lonelyn Jordan','1980-02-12','Belison Antique',152,60,11,'Philippines','Philippines','66929011','JAL353164','Catholic',3,'New',7,'Married',3,'16,11,3','53087.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-14 13:27:25','2016-03-14 17:27:25','N','14948.jpg','Available',0.00,'','','https://youtu.be/HCfc2JjxKlE',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 35 years of age, married with 3 children ages 3, 11 and 16. She wants to work in Singapore as a domestic helper to support her children for their education and for them to be successful in their lives. While away for 2 years, her husband and her parents will be responsible in taking care of her children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as hardworking, kind, trustworthy and honest. She loves to read, listens to news and does household chores.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as housemaid for more than 8 years where her responsibilities were doing household chores, laundry, cooking and caring for the 2 elderly and the special child; she prepares for their meals and feed them on time.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She knows how to cook and will cook for her employer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She is also prepared to take care of children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eldercare</strong></p>\r\n\r\n<p>She has experience in taking care of an elderly. And she is willing to take care of them if given a chance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>I could see that she cannot able to express herself well but she is hardworking. She is flexible and willing to adjust herself to any situation. In her previous job, she takes care of the 2 elderly as well as a special child. That was not an easy task but she was able to manage her work and time well. She just needs little time to cope up. I hope that you look into her profile and consider her then.</p>\r\n'),(223,'Cheryll Tumulak','1978-07-16','Iloilo',150,48,11,'Philippines','Philippines','66929011','JAL373157','Catholic',4,'Ex-Singapore',5,'Married',2,'18,16','82734.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-14 13:15:04','2016-03-14 17:15:04','N','22584.jpg','Available',0.00,'','','https://youtu.be/nS6FP6HY_ao',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 37 years of age, married, and she has 2 children ages 18 &nbsp;and 16. She wants to work as a domestic helper to help her husband support their kids.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as simple, honest, trustworthy and responsible. When she has free time, she repairs the clothes and play with children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works in Singapore for 8 months where she wakes up early in the morning to prepare for their meals, feed the dog and send children to school. She did not finish her 2 year contract because her employer told her that since there&#39;s no much work to do in the house and that the kids are staying at school almost all day, it would be better if they let her go home.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She could cook and she would prepare meals for her employer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She is also prepared to take care of children. She is a mother herself and she works in Singapore taking care of kids.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pet care</strong></p>\r\n\r\n<p>She loves pets. When in Singapore, she has experience taking care of pets and she is willing to take care of them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She is a mother herself who takes care of her own children since they were born and aside from that, she works in Singapore taking care of kids. She is willing to take care of pets. She works in Singapore for awhile and I believe that there&#39;s no much adjustment needed for her to adapt to the lifestyle and standard of work. As far as experience is concerned, I do believe that she will be a good helper. I do believe in her capabilities. I hope you visit her profile and consider her then.</p>\r\n'),(224,'April Kristine Pangantihon','1987-04-02','Malaybalay City',157,60,11,'Philippines','Philippines','66929011','MAF283001','Catholic',4,'New',2,'Married',1,'9','56936.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-02-24 09:10:51','2016-02-10 10:18:58','Y','41027.jpg','Available',0.00,'','','https://youtu.be/KUBhcOqR8qc',NULL,''),(225,'Ruth Fantilaga','1990-11-10','Kalilangan Bukidnon',157,58,11,'Philippines','Philippines','66929011','MAL253004','Christian',4,'New',0,'Single',NULL,'','70338.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-15 04:35:19','2016-03-15 08:35:19','N','73327.JPG','Available',0.00,'','','https://youtu.be/dKDWql4uvcU',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 25 years of age and single. She was a college student but due to financial reasons, she decided to quit her school and apply for a domestic helper to support family. She is an undergraduate of Elementary Education. Her father is a farmer and her mother is stay at home mother.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as a loving Aunt to her niece and nephew. Since she is an undergraduate educator, she would love to teach children especially with their home works. For her, a quality of a good helper should have an initiative to do the task.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as a helper for 1 year where she cooks, clean the house and take care of the kids. She loves kids and since she is the youngest in the family with 11 siblings, she has plenty of niece and nephew and she gets too many chances in taking care of them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She could cook for her employer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She is prepared to take care of children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Elderly care</strong></p>\r\n\r\n<p>She has no experience in taking care of an elderly but she is willing to learn.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She is young yet very committed to what she does. I could see that she is sincere to what she says. She has knowledge in cooking and willing to take care of children. She is also suitable for an elderly care based on her height and built. She is a person who wants to learn and willing to adjust to a new environment. She just needs some time. And I do hope that you will visit her profile and consider her then.</p>\r\n'),(226,'Lovely Balasa','1989-08-25','Kalilangan Bukidnon',157,43,11,'Philippines','Philippines','66929011','MAL263003','Catholic',3,'New',0,'Separated',2,'9,8','76337.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-15 04:37:45','2016-03-15 08:37:45','N','83429.JPG','Available',0.00,'','','https://youtu.be/SKxQIertxG8',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 26 years of age, separated and she has 2 children ages 9 and 8. She is a high school graduate and she is applying to work as a domestic helper. While away for 2 years, her mother will look after her 2 children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as simple, not demanding and will do her best to do her job well. She loves to go to church every Sunday.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;Experience</strong></p>\r\n\r\n<p>She works in Qatar as a helper for more than a year. It was a 3-storey house. Her main responsibilities were to clean the first floor area and to take care of the kids when they are home after school.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She could cook basic meals and she is willing to learn more ways of cooking in Singapore.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She loves children and she is willing and prepared to take care of them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She is someone who is willing to work and willing to learn. And she is also willing to listen and follow instructions to make her work better. She is determined. And I could see her sincerity in her words that she is willing to work even harder if given a chance. She just needs time to cope up but I know she could manage that. I could see that based on her personality, she could be a good helper to you. Hope you give her a chance and consider her then.</p>\r\n'),(227,'Geraldine Colipano','1980-12-18','Bukidnon',157,50,11,'Philippines','Philippines','66929011','MAL343001','Catholic',3,'New',0,'Married',2,'14,12','13807.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-15 04:22:03','2016-03-15 08:22:03','N','18757.JPG','',0.00,'','','https://youtu.be/lzXTDd0trVQ',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 34 years of age, married and has 2 kids. &nbsp;Her husband is a farmer.&nbsp;&nbsp; She wants to work in Singapore to help her family. While away for 2 years, her husband will take care of their children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as simple and willing to work. When she has free time, she loves to clean the house. For her, a quality of a good helper should have a good attitude and must be god fearing.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>As a mother, she took care of her own children since they were born. And as a housewife, she does cooking, laundry and house cleaning. She ensures that her family is always in good health.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She loves to cook and as a mother and a housewife she prepares meals for her family. She is also willing to learn how to cook Chinese dishes.</p>\r\n\r\n<p>&nbsp;</p>