ct with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Lientje is capable to take care of an elderly and children. She has managed to look after a 60 year old elderly when she was in Malaysia. I do believe that she is suitable to small and simple family household. When it comes to adjustment, I could see that she could manage to adapt well based on her past experience working Abroad. She could cook well and I could see that she has pleasant personality. I hope that you could manage to view her profile and consider her then.</p>\r\n'),(255,'Esther Diana Tangel','1986-09-09','North Sulawesi',161,47,12,'Indonesia','Indonesia','66929011','IND303129','Christian',3,'Ex-Singapore',2,'Married',2,'13,8','27213.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-05 02:04:24','2016-03-03 15:44:58','Y','19205.jpg','Available',0.00,'','','https://youtu.be/1XZnyxBj8B4',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Esther is 30 years of age, married and she has 2 children. She works in Singapore for 6 years and now she wants to be back to work as domestic helper to earn money to support for her family.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as hardworking, obedient and honest. She is young and cheerful. Kids would surely love to mingle with her.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Esther works in Singapore for 6 years as a domestic helper. For 6 years, she had 3 employers. For her 1st employer, she works for 2 years taking care of a 70 year old bedridden elderly person. She changes diaper and takes her a bath. Aside from that, she also does cleaning and cooking for the 3 members of the family.</p>\r\n\r\n<p>For her 2nd employer, she looks after an elderly person but still able to walk. She works there for 1 year and 8 months because that time Ah mah no longe