n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Megawati is very cheerful and I believe that kids will like her and will mingle with her. She could cook and do household. At her age, she could pick up fast, however, she needs time to adjust. Giving her time, she could be able to manage well. I hope that you view her profile and consider her then.</p>\r\n'),(258,'Nevie Olga Wonok','1974-11-10','North Sulawesi',145,49,12,'Indonesia','Indonesia','66929011','IND423133','Christian',3,'Ex-Singapore',3,'Married',2,'17,2','35155.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-08 06:07:06','2016-03-07 15:27:38','Y','59518.jpg','Available',0.00,'','','https://youtu.be/URvaRARZ-1M',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Nevie is 41 years of age, married and she has 2 children ages 17 and 3. She wants to work in Singapore again to make money for her family.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as hardworking. She is Christian and there&#39;s no problem with her cooking and eating pork. Working in Singapore, she learned to do marketing, cooking Chinese and Malay dishes and speaking English.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Nevie works in Singapore for 6 years with 1 employer. Her responsibilities were cooking, cleaning, laundry, marketing once a week and taking care of the 2 young kids; sending and fetching them from and to school.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Working in Singapore, she learned to cook local Chinese and Malay dishes and wants to learn more. She cooks fried rice, steam fish, soup and others.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She expresses that she likes kids and she likes to take care of them. She works in Singapore taking care of young kids and she has managed well.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>I could see that Nevie has a pleasant personality and she could be good with kids. She is a mother herself and she has heart for the kids. She is suitable to simple household. When it comes to adjustment, I could see that she could manage to adapt well based on her past experience working in Singapore. She could cook well and she could cook for your family. I hope that you could manage to view her profile and consider her then.</p>\r\n'),(259,'Jultje Idamaris Entaren','1969-06-09','North Sulawesi',145,50,12,'Indonesia','Indonesia','66929011','IND473134','Christian',3,'Ex-Singapore',5,'Married',3,'23,19,16',NULL,'No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference',NULL,'Telephone / Teleconference','',53,'','2016-03-03 03:35:33','2016-03-02 15:07:40','Y','91608.jpg','Available',0.00,'','','https://youtu.be/893lfdDTqak',NULL,''),(260,'Susie Biocales','1989-12-31','Zarraga Iloilo',150,52,11,'Philippines','Philippines','66929011','JAL263178','Catholic',4,'Ex-Singapore',4,'Single',NULL,'',NULL,'No',NULL,'No',NULL,'No',NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,53,'','2016-03-10 07:19:20','2016-03-10 12:03:53','Y',NULL,'Available',0.00,'','',NULL,NULL,''),(261,'Susie Biocales','1989-12-31','Zarraga Iloilo',150,52,11,'Philippines','Philippines','66929011','JAL263178','Catholic',4,'Ex-Singapore',4,'Single',NULL,'','12099.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-14 07:11:00','2016-03-14 11:11:00','N','15303.jpg','Unpublished for display',0.00,'','','https://youtu.be/xul0QZK0q8o',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Susie is 26 years of age, single, and she has 3 brothers and 1 sister. She works in Singapore for almost 3 years and she is again applying to work as domestic helper because she needs to earn money to save for her future and also to help her family.</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>Susie describes herself as simple, happy and patient. She loves reading books, do gardening and cooking when she has free time. Working in Singapore, she learns to build relationship with her employer, has managed to adapt well to new working environment. Arriving in Singapore for the first time before, she doesn&rsquo;t know anything but learned a lot working there for about 3 years. She is aware now that they have high standard when it comes to cleaning and hygiene.</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Susie works as helper in Singapore for about 3 years where she had 2 employers. For her 1st employer, she only lasted for a month as she and her employer haven&rsquo;t had a good relationship. That&rsquo;s common issue for 1st timer who arrived in Singapore as they need time to adjust and eventually should adapt to the new culture and work standard. Then, for her 2nd employer, she works for over 2 years. Her responsibilities were cooking 3 times a day for 5 members of the family, cleaning the house, car washing and doing laundry.</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Working in Singapore, she learned some basic Chinese dishes and able to cook for her employer.</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>Although, she is single but she looks after her nephews when she is Philippines. And going back to Singapore, she is comfortable that she could manage to take care of children. She is teachable and she is willing to learn.</p>\r\n\r\n<p><strong>Pet care</strong></p>\r\n\r\n<p>Despite that she has no experience handling pets in Singapore, she still expresses herself that she loves pets and she is willing to learn and take care of pets.</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>Susie is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&rsquo;s instruction regarding hand phone usage.</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>Susie is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Susie works in Singapore for quite some time; she learned new culture and has adjusted herself to different environment. She learned that Singapore has a high standard especially in cleaning and hygiene. As I could see, she had worked well in her last employer. She is more independent now and that was what she learned from her past experiences. I believe that would help her overcome new challenges in her future employer. I could see that she just needs a little time to settle down and she could work well in a new family. She is suitable helper to small family. Please view her profile and consider her then.</p>\r\n'),(262,'Lyza Mae Ferrer','1986-12-21','Buenavista Guimaras',157,60,11,'Philippines','Philippines','66929011','JAL293177','Christian',4,'Ex-Singapore',1,'Separated',1,'9','48323.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-10 07:35:51','2016-03-10 12:35:51','N','70167.jpg','Available',0.00,'','','https://youtu.be/9jTEqZm302k',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Lyza is 29 years of age, separated, and she has 1 child. She works in Singapore for 4 years and she is again applying to work as domestic helper because she needs to support her only child alone as she had been separated. While she will be away for 2 years, her parents will take care of her child.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>Lyza describes herself as simple and happy person and a loving daughter to her parents. She loves to do cooking and read books when she has free time. Working in Singapore, she learns to adjust to another lifestyle and to adapt to their culture and to have an open communication with her employer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Lyza works as helper in Singapore for 4 years for a Chinese family with 3 children. Her main responsibility is to care for the youngest child aged 6 that time. She prepares her for school and fetches her. She cooks lunch and dinner for 5 members of the family. She also cleans the house and make sure everything is in order. She also did laundry.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Staying in Singapore for 4 years, she learned to cook Chinese dishes and able to cook for the whole family.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>Lyza is a flexible helper who looks after the kids for 4 years when she was working in Singapore. And going back, she is comfortable to take care of kids aged 4 and up. She has also become a mother who has the heart for the kids.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>Lyza is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&acirc;&euro;&trade;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Lyza works in Singapore for quite some time; she learned new culture and has adjusted herself to different environment; from food to work standard and their way of living. She is focused and determined to work. I could see that she just needs a little time to settle down and she could work well in a new family. She is experienced in taking care of children. She is suitable helper to care for your kids and to help in your household. She could also cook. Please view her profile and consider her then.</p>\r\n'),(263,'Rhea Gabrido','1987-03-12','Buenavista Guimaras',157,45,11,'Philippines','Philippines','66929011','JAL293179','Catholic',4,'Ex-Singapore',2,'Married',2,'8,7','12124.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-10 07:56:16','2016-03-10 12:56:16','N','32190.jpg','Available',0.00,'','','https://youtu.be/8lNNGOK5I5U',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 29 years of age, married, and she has 2 kids ages 9 and 7. She works in Singapore for almost 3 years and she is again applying to work as domestic helper because she needs to earn money to help her husband support their children. While she will be away for 2 years, her husband will take care of their children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as loving, honest and respectful. She loves to do cooking, reading books and bonding with her kids when she has free time. Working in Singapore, she learns how to manage time and how to do proper cleaning in Singapore household as she is aware that they have high standard when it comes to cleaning. She learns to adjust to their lifestyle and to adapt to their culture. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as helper in Singapore for about 3 years where she had 3 employers. For her 1st&nbsp;employer,