ted to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She works in Singapore for quite some time; she learned new culture and has adjusted herself to different environment. She learned that Singapore has a high standard especially in cleaning and hygiene. As I could see, she had worked well in her last employer. She is more independent now and that was what she learned from her past experiences. I believe that would help her overcome new challenges in her future employer. I could see that she just needs a little time to settle down and she could work well in a new family. She is experienced in taking care of children. She is suitable helper to care for your kids and to help in your household. Please view her profile and consider her then.</p>\r\n'),(264,'Verlyn Valdevieso','1986-12-22','Tigbauan Iloilo',158,55,11,'Philippines','Philippines','66929011','JAL293180','Catholic',4,'Ex-Singapore',0,'Married',0,'','86158.jpg','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-10 09:31:41','2016-03-10 14:31:41','N','11574.jpg','Unpublished for display',0.00,'','','https://youtu.be/nQTFzUkgl0I',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Verlyn is 29 years of age, married, and she has no children yet. She works in Singapore for 4 years and she is again applying to work as domestic helper because she want to earn money to save for their future for they has plans to build their own house.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as simple, hardworking and willing to learn new things. She also loves to read books when she has free time. Working in Singapore, she learns to build good working relationship with her employer and to Ah Mah, and she has managed to adapt well to new working environment. Arriving in Singapore for the first time before, she doesn&acirc;&euro;&trade;t know anything but learned a lot working there for about 3 years. She