\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Verlyn works in Singapore for quite some time; she learned their culture, their lifestyle and even their standard in a household. djusted herself to different environment. She learned that Singapore has a high standard especially in cleaning and hygiene. As I could see, she had worked well in her last employer. She is more independent now and that was what she learned from her past experiences. I believe that would help her overcome new challenges in her future employer. I could see that she just needs a little time to settle down and she could work well in a new family. She is suitable helper to small family. Please view her profile and consider her then.</p>\r\n'),(265,'Mylen Villalobos','1984-03-05','Banate Iloilo',157,45,11,'Philippines','Philippines','66929011','JAL313132','Catholic',3,'Ex-Singapore',7,'Separated',1,'9','97310.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-10 08:44:23','2016-03-10 13:44:23','N','59081.jpg','Available',0.00,'','','https://youtu.be/DTymAqrytrw',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Mylen is 32 years of age, separated and she has a 9 year old son. She works in Singapore for over 2 years and now&nbsp;she wants to be back to work as domestic helper to save money and build her own house together with her son and also to support his studies.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as loving, caring, understanding. She seems to be determined mother since has to support her son. Working in Singapore, she learns to adapt to the working environment and could be able to work well in the future.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Mylen works in Singapore for more than 2 years as a domestic helper. For over 2 years, she had 2 employers. For her 1stemployer, she works for a year and 3 months where her responsibilities were cleaning a 2 storey house with 5 bedrooms, doing laundry and ironing clothes for 8 members of the family and car washing. She didn&#39;t stay for 2 years because another helper in the house had an issue with her and she decided to go home.</p>\r\n\r\n<p>For her 2nd&nbsp;employer, she works for a year and 3 months, every day she cleans a 3 storey house with a basement where she is the only helper in the house. She also cooks and wash the car.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Working in Singapore for over 2 years, she got to know how to cook Chinese dishes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Children</strong></p>\r\n\r\n<p>As a mother, she has the heart to take care of children and going back to Singapore, she expresses that she could take care of children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Mylen is someone who is teachable and would be willing to learn. She works in Singapore for 2 years and I do believe that there&#39;s no much adjustment needed when it comes to cleaning and cooking. She could be able to adjust in a short time. She is a mother and she should be good with kids. I hope that you could be able to view her profile and consider her then.&nbsp;</p>\r\n'),(266,'Janice Aguinaga','1984-12-07','Zarraga Iloilo',145,39,11,'Philippines','Philippines','66929011','JAL313181','Catholic',3,'Ex-Singapore',0,'Single',NULL,'','44851.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-19 03:29:42','2016-03-19 07:29:42','N','62629.jpg','Available',0.00,'','','https://youtu.be/4ciSEix_7jM',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Janice is 31 years of age, single and she has 1 brother. She works in Singapore for 2 years and now she wants to be back in Singapore to work as a domestic worker to save money for her future and to help her family.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as an honest, loyal, hardworking and responsible person. She loves to do gardening and reading books when she has free time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Janice works in Singapore for 2 years as a domestic helper and did finish her contract. For 2 years, she takes care of 6 pet dogs: every morning, she would cook dog food, take them a bath, feed them and bring them out for a walk. She would also give medicine and bring them to a doctor for regular check up. She also watches over Grandma, did cleaning in a 3 storey landed house and cooks meals sometimes. And working in Singapore, she builds a good relationship with her employer and also to Grandma who also lives in the house.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Working in Singapore for over 2 years, she assists in cooking and she learns some basic Chinese dishes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Children</strong></p>\r\n\r\n<p>She used to take care of nephews when she was in the Philippines. Coming back to Singapore, she is willing to take care of children probably those who are ages 4 and above.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pet care</strong></p>\r\n\r\n<p>She loves pets and she takes care of 6 pet dogs in Singapore for 2 years. Coming back, she is still comfortable caring for pets.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Janice is someone who is teachable and determined to learn. She works in Singapore for 2 years and I do believe that there&Atilde;&cent;&acirc;&sbquo;&not;&acirc;&bdquo;&cent;s no much adjustment needed when it comes to cleaning and cooking. She could be able to adjust in a short time. She loves pets and she is good in taking care of them. I hope that you could be able to view her profile and consider her then.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Video interview</strong></p>\r\n\r\n<p>To view her personal video interview please click&nbsp;<a href=\"https://youtu.be/4ciSEix_7jM\">https://youtu.be/4ciSEix_7jM</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eden Grace Maids and Employment Agency Pte Ltd</strong></p>\r\n\r\n<p>Address 61, Ubi Road 1, #03-36, Oxley Biz Hub, Singapore 408727<br />\r\nEmail&nbsp;<a href=\"mailto:edengrace_enquiry@yahoo.com.sg\">edengrace_enquiry@yahoo.com.sg</a><br />\r\nWEBSITE:&nbsp;<a href=\"http://www.edengracemaids.com/\">www.edengracemaids.com</a><br />\r\nOffice hours - Weekdays 9am to 6pm, Contact Person Chris Wong @ 91187703 or Alice Lee @ 92206000<br />\r\nAfter Office Hours- Weekends and Public Holiday, Contact Person - Alice Lee @ 92206000 or Susan Lee @ 83891511<br />\r\nOffice No: 66929011 /66929012 / 66929013</p>\r\n\r\n<p>MOM LIC 13C6831</p>\r\n\r\n<p>We believe a happy family and harmonious work-home environment is achievable with the management of expectations and a lifestyle of learning. Eden Grace aspires to cater to your needs for an ideal, dependable maid. We also hope to facilitate a good working relationship through proper integration and education programmes for both parties. We desire to guide domestic helpers to achieve their life goals during employment.</p>\r\n\r\n<p><em><strong>AN AGENCY WITH A DIFFERENCE<br />\r\n&quot;Building Lives, Building Families&quot;</strong></em></p>\r\n'),(267,'Jovelyn Kennedy','1983-04-15','Sibalom Antique',157,48,11,'Philippines','Philippines','66929011','JAL323176','Catholic',3,'Ex-Singapore',5,'Widowed',1,'1','21352.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-10 09:49:28','2016-03-10 14:49:28','N','87573.jpg','Available',0.00,'','','https://youtu.be/5fqwjNE_RKM',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 32 years of age, widowed, and she has a 1 daughter. She works in Singapore for 4 years and she is again applying to work as domestic helper because she needs to support her only child alone as she had been widowed already. While she will be away for 2 years, her parents will take care of her child.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as simple and trustworthy. She loves to do gardening and cooking when she has free time. Working in Singapore, she learns to adjust to another lifestyle and to adapt to their culture and to have an open communication to them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as helper in Singapore for 4 years where her responsibilities were to take care of 3 children ages 8, 4 and 2; all 3 children by herself. Aside from looking after the kids, she also cooks breakfast and dinner for the family and manage to do all the house cleaning chores.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Staying in Singapore for 4 years, her employer taught her to cook Chinese dishes and able to cook for them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She is a flexible helper who looks after the 3 young kids by all herself for 4 years when she was in Singapore. And she was able to manage that well. And going back to Singapore, she is comfortable to take care of kids as she has also become a mother who has the heart for the kids.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She works in Singapore for quite some time; she learned new culture and has adjusted herself to different environment; from food to work standard and their way of living. She is focused and determined to work. I could see that she just needs a little time to settle down and she could be well in a new family. She is experienced in taking care of children and infants. She is suitable helper to care for your kids and to help in your household. She is also a good cook. Please view her profile and consider her then.</p>\r\n'),(268,'Rose Mae Balgos','1982-10-15','Molo Iloilo City',150,57,11,'Philippines','Philippines','66929011','JAL333183','Christian',4,'Ex-Singapore',0,'Married',0,'','22266.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-10 10:32:25','2016-03-10 15:32:25','N','13194.jpg','Available',0.00,'','','https://youtu.be/vjhKAGIYTxY',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>She is 33 years of age, married and has no children. She is a certified caregiver and she works in Singapore already as a caregiver. Going back home from Singapore, she studied bible school and she is graduating.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as loving, caring, understanding and someone who has passion to care for the elderly or to person with special needs. She also loves to do gardening and sewing when she has free time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as a caregiver in Singapore where she takes care of her Ma&acirc;&euro;&trade;am who was highly dependable on someone because of she can&#39;t walk and can&#39;t do anything because of her disability. She tends to her Madam&acirc;&euro;&trade;s every needs. She went home earlier because someone to replace her was coming already.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Elderly care</strong></p>\r\n\r\n<p>She works in Singapore as a caregiver and she has to take care of a person with special needs and needs special attention. She is a certified caregiver who has proper exposure to this type of working environment.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>She is suitable to take care of an elderly based on her training and experience as a caregiver. She is someone who has passion towards her work. She is committed. And she is trained to this job and I know she could manage well. I hope that you view her profile and consider her then.</p>\r\n'),(269,'Jenalyn Bautista','1982-09-12','Kalibo Aklan',160,52,11,'Philippines','Philippines','66929011','JALN333175','Catholic',4,'New',3,'Married',0,'','31814.JPG','No','','No','','No','','','','1','','Singapore EA','',NULL,'','',53,'','2016-03-14 06:57:33','2016-03-14 10:57:33','N','49642.jpg','Unpublished for display',0.00,'','','https://youtu.be/IoOT89CF51w',NULL,''),(270,'Glenn Albor','1979-11-01','Bingawan Iloilo',154,50,11,'Philippines','Philippines','66929011','JAL373184','Catholic',3,'Ex-Singapore',0,'Married',2,'9,7','48214.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-10 11:06:17','2016-03-10 16:06:17','N','95604.jpg','Available',0.00,'','','https://youtu.be/xEomk-CFCX0',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Glenn is 36 years of age, married and she has 2 children ages 9 and 7. Her husband agreed to take care of their 2 children while she will be away for 2 years. She works in Singapore for 2 years before and now she wants to be back to work as domestic helper to earn money to help her family and for the future of her children. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as a happy person, loving, understanding and caring. She seems to be determined mother since has children to support back home. Working in Singapore, she learns to adapt to the working environment and could work well in the future.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><stro