 herself as honest, God-fearing and hardworking. During her free time, she loves to do gardening and take care of kids.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Mary Be works as helper in Jordan for 3 months taking care of the 3 kids ages 13, 9 and 4. She did house cleaning for the 4 storey house where she was the only helper. She did laundry, ironing and also cooking. She did not last long because she had no enough sleep; she works from 6am to 3am, giving her only 3 hours time to rest. She sleeps late since kids were up until late and she needs them to settle down first before she goes to bed herself.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Mary Be can cook basic Filipino dishes and she would like to learn other type of food.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>Although she has no experience in handling kids, however, she expresses herself that she loves children and she shows willingness to care for them in the future.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Mary Be is someone who is young and teachable. She should be suitable for family with young kids. She works abroad already, so I believe that she could manage to be away from home, although, she might still need some time to settle down since Singapore is another country. But giving her some time, I do believe that she could be able to adapt well and would be a good helper to you. Please view her profile and consider her then.</p>\r\n'),(273,'Lani Talabon','1990-01-27','Tigbauan Iloilo',152,50,11,'Philippines','Philippines','66929011','JAL263189','Catholic',4,'New',7,'Single',NULL,'','23880.JPG','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-12 08:44:30','2016-03-12 13:44:30','N','96004.jpg','Available',0.00,'','','https://youtu.be/6JNEzjdOQZg',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Lani is 26 years of age, single, and she has 4 brothers and 3 sisters. She is a nursing undergraduate. She wants to work as a domestic helper in Singapore because she wants to save money for herself and to help support her family.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as trustworthy, honest and hardworking. During her free time, she loves to read books for she wants to improve her communication skills.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Lani works as helper in Oman for 2 years where she takes care of 7 and 9 years old kids; she takes them a bath, feed them and teach them for their home work. She also did all around cleaning in a 2 storey, 7 bedrooms villa. Working in Oman, she learns to adapt to the new environment, respect their culture and she is confident that she could work well in the future.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She could cook basic Filipino dishes and would like to learn other type of food.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She works in Oman taking care of young kids, going back abroad to work, she expresses herself that she loves children and she shows willingness to care for them in the future.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eldercare</strong></p>\r\n\r\n<p>She has no experience in eldercare, although she is