oney for her family and to give them better life before she settles down.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as simple, loving and understanding. During her free time, she loves reading books and spends time with her family. Working abroad, she learns to build relationship with her employer, respect their culture and has managed to adjust her time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as helper in Lebanon for over 2 years with 2 employers. For her 1st&nbsp;employer, she works for a month for there was some issues happened between her employer and the agency. For her 2nd&nbsp;employer, she works for more than 2 years where her responsibilities were to cook and to look after her employer as she needs some assistance for she is in her senior years already. She cleans the house and maintains everything is in order.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Ronalyn works in Arab country and she learned how to cook Arabic food. She is confident that she will also learn to cook other food once in Singapore.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>Although she has no experience in handling kids, however, she expresses herself that she loves children and she shows willingness to care for them in the future.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Ronalyn is someone who is independent but teachable. She is someone reliable when it comes to a task assigned to her. She works abroad already, so I believe that she could manage to be away from home, although, she might still need some time to settle down since Singapore is another country and has a high standard when it comes to cleaning. But giving her some time, I do believe that she could be able to adapt well and would be a good helper to you. Please view her profile and consider her then.&nbsp;</p>\r\n'),(275,'Raiza Marañon','1987-07-23','Santa Barbara Iloilo',160,58,11,'Philippines','Philippines','66929011','JAL283191','Catholic',4,'New',4,'Single',NULL,'','81369.JPG','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-14 03:08:50','2016-03-14 07:08:50','N','27321.jpg','Available',0.00,'','','https://youtu.be/cIde_Mmw1jo',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Raiza is 28 years of age, single, and she has 2 brothers and 2 sisters. She works in Kuwait for almost a year and she is again applying to work as domestic helper because she needs to earn money to support the expenses of her younger sister who is in college.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as honest and hardworking. She loves kids. Working abroad, she learns to build relationship with her employer, respect their culture and has learned how to manage her time. For her a quality of a good helper is someone patient.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>Raiza has good number of years looking after children. She works as helper in Kuwait for almost a year where her responsibilities were to take care of 4 children ages 11, 9, 7 and 6 years old; she takes them a bath and sends them to school. &nbsp;She is also required to cook for the family. She also works in the Philippines for 3 years looking after 2 young kids ages 1 and 3.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>Raiza works in Arab country where she cooks for the family. She is confident that she will learn to cook other food once in Singapore.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>She has experience in taking care of children in her previous job and she has managed well. Going back abroad, she expressed herself that she wants to take care of children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eldercare</strong></p>\r\n\r\n<p>In the Philippines, she personally took care of her grandmother who was bedridden, she changes diaper and take her a bath. Coming to Singapore, she shows willingness to care for an elderly person.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Raiza is not new working as a housemaid; she could cook, take care of children and house work. She could also care for an elderly. She is open to learn new things and she is teachable. She works abroad already, so I believe that she could manage to be away from home, although, she might still need some time to settle down since Singapore is another country. But giving her some time, I do believe that she could be able to adapt well and would be a good helper to you. Please view her profile and consider her then.</p>\r\n'),(276,'Grace Talabon','1985-05-31','Tigbauan Iloilo',152,50,11,'Philippines','Philippines','66929011','JAL303188','Catholic',3,'New',7,'Single',NULL,'','3