ight still need some time to settle down since Singapore is another country and has a high standard when it comes to cleaning. But giving her some time, I do believe that she could be able to adapt well and would be a good helper to you. Please view her profile and consider her then.&nbsp;</p>\r\n'),(279,'Gine May Ciples','1992-04-14','Lapaz Iloilo City',152,47,11,'Philippines','Philippines','66929011','JAL233195','Catholic',4,'New',6,'Single',NULL,'','63676.JPG','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-14 05:51:23','2016-03-14 09:51:23','N','71525.jpg','Available',0.00,'','','https://youtu.be/bDnegcCHORk',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Gine May is 23 years of age, single, and she has 4 sisters and 3 brothers. She was an undergraduate in Journalism. She wants to work in Singapore as domestic helper to earn money to support her mother and also to save for her future.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as hardworking and honest. When she has free time, she loves to do gardening, cooking and teaching children with the assignments. For her, the quality of a good helper is someone patient and caring for the children and elderly person.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as a helper in the Philippines for almost 11 years; she started in her very young age. She works to take care of children ages 5 months old, 1 and 4 years old; she cleans the feeding bottles, cook and feed them, takes them a bath and changes diaper. She also cleans the house and cook.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>She cooks Filipino dishes and she is willing to learn other types of food once in Singapore.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>Gine May works as a housemaid where she takes care of young children, and ensures proper hygiene in handling children especially for infants. She makes sure that feeding bottles are properly washed and sterilized. And coming to Singapore, she is prepared to take care of children.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eldercare</strong></p>\r\n\r\n<p>She also used to assist her mother in taking care of her grandpa who got ill. She knows how to change diaper and to take him a bath. She is comfortable she could manage to take care of an elderly.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Gine May is young and flexible. She could communicate in English well. She should be suitable to work in a family with young kids as she may communicate to them well and could also teach them with their assignments. She could also cook and is willing to look after for elderly person. She just needs little time to adapt to the new culture and settle down and she could be a good helper to you. I hope you give her a chance and consider her then.</p>\r\n'),(280,'Joyce Sarillo','1991-07-06','Guimaras',152,39,11,'Philippines','Philippines','66929011','JAL243193','Catholic',3,'New',1,'Married',1,'','49625.JPG','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-12 10:22:14','2016-03-12 15:22:14','N','69887.jpg','Available',0.00,'','','https