 follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Joyce is a mother who looks after her child. She also works as a housemaid looking after a young kid and she has able to manage. She should be suitable to small family for child care, house cleaning and cooking. She just needs little time to adapt to the new lifestyle and she could settle down and be a good helper to you. I hope you give her a chance and consider her then.</p>\r\n'),(281,'Warrich Joy Solinap','1981-11-08','Jaro Iloilo City',163,49,11,'Philippines','Philippines','66929011','JAL333194','Catholic',3,'New',5,'Married',1,'6','62078.JPG','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-14 02:55:12','2016-03-14 06:55:12','N','64790.jpg','Available',0.00,'','','https://youtu.be/DpiuIPUHNWM',NULL,'<p><strong>Background</strong></p>\r\n\r\n<p>Warrich Joy is 34 years of age, married, and she has a 6 year old child. She wants to work in Singapore as domestic helper to earn money to support her mother and especially her child. She has 3 brothers and 1 sister.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Personality</strong></p>\r\n\r\n<p>She describes herself as responsible, honest and hardworking. When she has free time, she loves to do gardening. For her, a quality of a good helper is someone loyal and hardworking.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as a helper in the Philippines for 15 years; she started in her very young age. She works for 1 family where her responsibilities where to take care of the 3 year old child, house cle