r kids; swimming with kids, watching television and teaching them to read and write</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Experience</strong></p>\r\n\r\n<p>She works as a housemaid in the Philippines for 10 years; she started while she was still studying in college. She did house cleaning, cooking and taking care of a child. Aside from that, she is a mother of 2 children who looks after her children since they were born.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cooking</strong></p>\r\n\r\n<p>As a mother, she cooks meals for her family. She cooks Filipino dishes and she is willing to learn other types of food once in Singapore.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Childcare</strong></p>\r\n\r\n<p>Edith works as a housemaid where she takes care of a child, and as a mother, she takes care of her children since new born. Coming to Singapore, she is prepared to take care of children and will treat them as her own.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eldercare</strong></p>\r\n\r\n<p>She also assists in taking care of her employer&#39;s parent who got sick. She knows how to change diapers and willing to be trained on other things to do.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pet care</strong></p>\r\n\r\n<p>Taking care of pets will not be a problem with her as she is prepared and willing to learn.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Hand phone</strong></p>\r\n\r\n<p>She is comfortable that her employer will keep her hand phone during working hours so that she can focus on her work.&nbsp; She will follow the employer&#39;s instruction regarding hand phone usage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2 years contract</strong></p>\r\n\r\n<p>She is aware that she will enter into 2 years contract with her future employer and she is committed to finish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Edith is a mother who looks after her children. She also works as a housemaid looking after a child and she has able to manage. She works as a helper for a long time. She should be suitable for child care, house cleaning and cooking. She just needs little time to adapt to the new lifestyle and she could settle down and be a good helper to you. I hope you give her a chance and consider her then.</p>\r\n'),(288,'Ma Dolores Furio','1986-07-30','Hamtic Antique',150,48,11,'Philippines','Philippines','66929011','JAL293203','Catholic',4,'New',1,'Married',2,'7,3','45132.JPG','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-12 08:15:48','2016-03-12 13:15:48','N','23585.jpg','Available',0.00,'','','https://youtu.be/MbvvSUP82Tk',NULL,''),(289,'Virgie Salazar','1982-10-08','San Jose Antique',155,45,11,'Philippines','Philippines','66929011','JAL333201','Catholic',3,'New',5,'Separated',2,'10,8','39407.JPG','No','','No','','No','','','','1','','Singapore EA','Interviewed via telephone / teleconference;Interviewed via videoconference',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-12 08:29:40','2016-03-12 13:29:40','N','31130.jpg','Available',0.00,'','','https://youtu.be/5WyES9qYpPE',NULL,''),(290,'Adelaida Reyes Agag','1989-08-09','Laoag City Ilocos Norte',162,48,11,'Philippines','Philippines','66929011','BAC264001','Christian',3,'New',6,'Separated',1,'7','24537.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed in person',NULL,'Telephone / Teleconference;Videoconference','',53,'','2016-03-16 03:43:25','2016-03-16 07:43:25','N','76999.jpg','Available',0.00,'','','https://youtu.be/Wt4SvSPbonU',NULL,''),(291,'Analiza C Oasay','1986-02-02','Pinili Ilocos Norte',152,40,11,'Philippines','Philippines','66929011','BAD304008','Catholic',3,'Ex-Singapore',4,'Married',1,'8','61886.jpg','No','','No','','No','','','','1','','Singapore EA','Interviewed in person',NULL,'Telephone / Teleconference;Videoconference','',53,''