.sg/agencies/309-M-Choices?height=640&amp;width=640\">Multiple Choices</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/325-Mega-Search?height=640&amp;width=640\">Mega Search Employment Services</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/310-Ming?height=640&amp;width=640\">Ming Employment</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/200-MJ?height=640&amp;width=640\">MJ Employment Services</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/588-MWMS?height=640&amp;width=640\">MW Manpower Solution</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/443-MyHelper?height=640&amp;width=640\">MyHelper Pte Ltd</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/595-NannyPro?height=640&amp;width=640\">NannyPro Pte Ltd</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/422-OK-Maid?height=640&amp;width=640\">OK Maid Pte Ltd</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/110-OneClick?height=640&amp;width=640\">OneClick Employment Agency LLP</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/552-One-Employment?height=640&amp;width=640\">One Employment Solutions &amp; Services Pte Ltd</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/525-Passion?height=640&amp;width=640\">Passion Maid &amp; Employment Agency Pte Ltd</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/544-Passion-Far-East?height=640&amp;width=640\">Passion Maid &amp; Employment Agency Pte Ltd</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/610-Peace-Maid?height=640&amp;width=640\">Peace Employment Pte Ltd</a></li>\r\n				<li><a href=\"http://www.netmaid.com.sg/agencies/192-Perfect-Team?height=640&amp;width=640\">Perfect Team Maid Agency Pte Ltd</a></li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','2015-10-29 08:18:19','2015-11-03 10:45:06',1),(2,'F&Q','<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse1\">Why choose Innomaid?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse1\">\r\n<div class=\"panel-body\">\r\n<p>This is because our maid agencies from Innomaid provide excellent service and do it right for our customers as we value the needs of our customers as the top priority.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse2\">Which country should I hire my maid from?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse2\">\r\n<div class=\"panel-body\">\r\n<p>Generally, we have received feedbacks from our customers that Filipino maids are the best maids. The primary reason given is that choosing to hire a maid from the Philippines is that they are generally thought to be more fluent in English. However, the drawback is that Filipino maids generally cost more as they are also known to be more demanding. At the end of the day, it is still self-preference and it all depends on your decision.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse3\">What are the countries that I can employ maid from?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse3\">\r\n<div class=\"panel-body\">\r\n<p>MOM(Ministry of Manpower) has approved source of countries for FDW(Foreign Domestic Workers). These countries are :Phillipines, Sri Lanka, india, Myanmar, Thailand, Indonesia, Malaysia and Bangladesh.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse4\">Which country should I hire my maid from?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse4\">\r\n<div class=\"panel-body\">\r\n<p>Generally, we have received feedbacks from our customers that Filipino maids are the best maids. The primary reason given is that choosing to hire a maid from the Philippines is that they are generally thought to be more fluent in English. However, the drawback is that Filipino maids generally cost more as they are also known to be more demanding. At the end of the day, it is still self-preference and it all depends on your decision.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse5\">How many maid agencies are there in Singapore?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse5\">\r\n<div class=\"panel-body\">\r\n<p>According to MOM published statistics to-date, there are more than 1100 licensed maid agencies in Singapore. However, the maid agencies that are recommended by Innomaidare the ones that you should choose as they provide the best service that you can trust.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse6\">What is a security bond and when to get the bond?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse6\">\r\n<div class=\"panel-body\">\r\n<p><strong>Security bond</strong><br />\r\nA security bond is a binding pledge to pay the government if you break the lawy or conditions governing the employment of a helper. You need a bond for every helper you employ unless she is a Malaysian.</p>\r\n\r\n<p>Bond usually take the form of an insurance and the insurers will pursue you for the money if you break the rules.</p>\r\n\r\n<p><strong>When to get the bond</strong><br> You need to buy the bond before the helper arrives in Singapore. When you buy the bond, the information may take up 5 working days for MOM(ministry of Manpower) to process.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse7\">Can I avoid making the $5,000 deposit?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse7\">\r\n<div class=\"panel-body\">\r\n<p>Yes, you will have to purchase an insurance policy with carious options from Anda or NTUC Income to avoid making the deposit.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse8\">What medical checks are required for my maid?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse8\">\r\n<div class=\"panel-body\">\r\n<p>Withing the first 2 weeks upon your maid arrival to Singapore, she will be required to undergo a medical examination and be certified to be healthy and fit. The maid will then have to undergo six-monthly medical screening for VDRL, pregnancy and HIV.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse9\">Do I have to pay the maid salary when she goes on home leave?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse9\">\r\n<div class=\"panel-body\">\r\n<p>Yes, the employer is required to pay home leave including the return air ticket of at least 14 days if contract is to be extended.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse10\">What if my maid went missing?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse10\">\r\n<div class=\"panel-body\">\r\n<p>You should forfeit her work permit immediately to stop the levy payment. You will be then be given 1 month to locate and repatriate her or else, you will lose the $500 security deposit.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse11\">What if my maid got pregnant?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse11\">\r\n<div class=\"panel-body\">\r\n<p>You must repatriate your maid immediately.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel panel-default\">\r\n<div class=\"panel-heading\">\r\n<h4 class=\"panel-title\"><strong><a data-parent=\"#accordion1\" data-toggle=\"collapse\" href=\"#collapse12\">Can I employ a maid on a part-time basis?</a></strong></h4>\r\n</div>\r\n\r\n<div class=\"panel-collapse collapse\" id=\"collapse12\">\r\n<div class=\"panel-body\">\r\n<p>You According to MOM(ministry of manpower), their regulation stated that part-time employment of maids are strictly not allowed.</p>\r\n</div>\r\n</div>\r\n</div>\r\n','2016-03-19 12:31:04','2016-03-19 16:31:04',1),(3,'About US','<p>Innomaid is a platform for to help employers search for their ideal maid and assist them to find the most suitable Maid Agency to provide them according to their needs. Innomaid is also an application specially designed to help maid agencies manage their data.</p>\r\n\r\n<p>If you wish to contact us, here is our contact details.</p>\r\n\r\n<p>100 Jalan Sultan, Sultan Plaza<br>6391 3901<br> <a href=\"http://innov8te.com.sg/\" target=\"_blank\">http://innov8te.com.sg/</a></p>\r\n','2016-03-19 12:03:20','2016-03-19 16:03:20',1),(4,'Test Page','<p>This is must a Page created for Testing</p>\r\n','2015-11-15 17:26:11','2015-12-23 10:52:30',0),(5,' A C','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n','2015-11-18 10:23:52','2015-12-23 10:52:53',0),(6,'Page Title','<p>Page Content</p>\r\n','2015-12-29 12:24:39','2015-12-29 12:24:39',1);
